// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from './pages/HomePage';  // Your homepage component
import RentersInsight from './pages/RentersInsight';  // The page for Renters Insight
import Navbar from './components/Navbar';  // Navbar component

function App() {
  return (
    <Router>
      {/* Navbar will appear on all pages */}
      <Navbar />

      {/* Switch handles routing */}
      <Switch>
        <Route path="/" exact component={HomePage} />
        <Route path="/renters-insight" component={RentersInsight} />
      </Switch>
    </Router>
  );
}

export default App;
